import React, { Component } from 'react'
import Menu from '../Menu/Menu'
import '../Men/Men.css'
class Men extends Component {
    render() {
        return (
            <>
             <Menu />
                <div className="menContainer">
                    <h1>Men</h1>
                    <ul>
                        <li className="mencard">
                            <img className="productImage" src="https://cdn.shopify.com/s/files/1/0115/6254/9306/products/2019-New-Spring-Autumn-Fleece-Men-Winter-Jacket-Plaid-Classical-Button-Jacket-M-3XL_1_2000x.jpg?v=1561576187" alt="men clothng" />
                            <h5>Plaid Jacket</h5>
                            <p>$150</p>
                        </li>
                    </ul>        
                </div>
            </>
        )
    }
}
export default Men;
